import logo from '../logo.png';
import '../styling/Home.css';

function Home() {
  return (
    <div className="Home">
      <header className="Home-header">
        <h1>Welcome to CourseCompass!</h1>
        <h4></h4>
      </header>
    </div>
  );
}

export default Home;
